import React, { useState, useEffect } from "react";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from "./components/CityCard";
import axios from "axios";

function App() {
  const [weather, setWeather] = useState({
    people: []
  })
    const { people } = data;

  useEffect(() => {
    axios
      .get(
        `http://api.openweathermap.org/data/2.5/forecast?id=524901&APPID=62029f0d3701271a5e50142b280915f0`
      )
      .then((res) => {
        const data = res.data
        setWeather({data});
      })
      .catch((error) => {
        return "Invalid Search";
      });
    }, []);

  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        {people.map(item => (
          <li>{item.list}</li>
        ))}
      </header>
    </div>
  );
}

export default App;

